import TextField from '@mui/material/TextField';
import { ThemeProvider, createTheme, makeStyles } from '@mui/material/styles';


const SignIn = () => {
 
    return (
      <TextField 
        id="standard-basic" 
        label="Name" 
        variant="standard"
      />  
    )
  
}

export default SignIn;
